import { useState } from "react";
import { HashRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import Home from "./Components/Home/Home";
import "./index.css";
import SignUp from "../src/Components/SignUp/SignUp";
import Login from "../src/Components/SignUp/Login";
import CoursesPageUIUX from "../src/Components/CoursesPageALL/UIUX/CoursesPageUIUX";
import CoursesPageDjango from "../src/Components/CoursesPageALL/Django/CoursesPageDjango";
import CoursesPageFE from "../src/Components/CoursesPageALL/Frontend/CoursesPageFE";
import DashBoard from "../src/Components/DashBoard/DashBoard";
import MyCourses from "../src/Components/DashBoard/MyCourses";
import MyCertificate from "../src/Components/DashBoard/MyCertificate";
import MyNotification from "../src/Components/DashBoard/MyNotification";
import LandingPage from "../src/Components/LAndingPage/LandingPage";
import PasswordReset from "../src/Components/SignUp/PasswordReset";
import CreatePassword from "../src/Components/SignUp/CreatePassword";

function App() {
    const [isAuthenticated, setIsAuthenticated] = useState(false);

    const checkLocalStorage = localStorage.getItem('ent')

    function checkUserAuthentication(){
        if(checkLocalStorage === ''){
            return true
        }else {
            return false
        }
    }

    // Custom authentication check
    const checkAuth = () => {
        // Implement your authentication logic here
        // You can use a state, context, or authentication service to check if the user is authenticated
        // Set isAuthenticated to true if the user is authenticated, otherwise false
     setIsAuthenticated(checkUserAuthentication());
        return isAuthenticated;
    };

    return (
        <Router>
            <Routes>
                <Route
                    exact
                    path="/LandingPage"
                    element={<LandingPage />}
                />
                <Route exact path="/" element={<Home />} />
                <Route exact path="/signup" element={<SignUp />} />
                <Route exact path="/Login" element={<Login />} />
                <Route exact path="/passwordreset" element={<PasswordReset />} />
                <Route
                    exact
                    path="/createpassword/:uidb64/:token"
                    element={<CreatePassword />}
                />
                <Route
                    exact
                    path="/coursespageuiux"
                    element={
                        checkAuth() ? <CoursesPageUIUX /> : <Navigate to="/Login" replace />
                    }
                />
                <Route
                    exact
                    path="/coursespagedjango"
                    element={
                        checkAuth() ? (
                            <CoursesPageDjango />
                        ) : (
                            <Navigate to="/Login" replace />
                        )
                    }
                />
                <Route
                    exact
                    path="/coursespagefe"
                    element={
                        checkAuth() ? <CoursesPageFE /> : <Navigate to="/Login" replace />
                    }
                />
                <Route
                    exact
                    path="/dashboard"
                    element={
                        checkAuth() ? <DashBoard /> : <Navigate to="/Login" replace />
                    }
                />
                <Route
                    exact
                    path="/mycourses"
                    element={
                        checkAuth() ? <MyCourses /> : <Navigate to="/Login" replace />
                    }
                />
                <Route
                    exact
                    path="/mycerti"
                    element={
                        checkAuth() ? <MyCertificate /> : <Navigate to="/Login" replace />
                    }
                />
                <Route
                    exact
                    path="/mynoti"
                    element={
                        checkAuth() ? <MyNotification /> : <Navigate to="/Login" replace />
                    }
                />
            </Routes>
        </Router>
    );
}

export default App;
